import styled from "styled-components";

import corbel from '../../Resources/corbel.ttf'

injectGlobal`
  @font-face {
    font-family: 'Coda';
    src: url(${Coda});
  }
`
const heading = styled.h1`
  font-family: Coda;
`

const Tema1_2 = styled.div`
background: #26273D;
min-height: 100%;
min-height: 100vh;
overflow: auto;    
`;

const Tema1_2_H1 = styled.h1`
> * {
    color: #A3A7B0;
    font-size: 35px;
  }
`;

console.log("TESTE");

export {Tema1_2, Tema1_2_H1} ;
